<body

   data-render-url="https://render.githubusercontent.com"
   data-github-hostname="github.com"

    <li data-mode="normal" class="js-view-mode-item">Surface Angle</li>
    <li data-mode="solid" class="js-view-mode-item active">Solid</li>
  </ul>
  <span class="render-message">

      nose_bridge_with_strap.stl</a> rendered with &#10084; by <a href="https://github.com" target="_parent">GitHub

<!-- /render bar -->

<!-- render info -->
<div class="render-info">
  <div class="js-viewer-health render-health">
    <span class="symbol">&#8854;</span>
    <span class="js-message message"></span>
  </div>
</div>
<!-- /render info -->

<!-- render viewport -->
<div id="solid-viewer" class="render-viewport" data-file="https://raw.githubusercontent.com/EmilyBennett/emilybennett.github.io/master/nose_bridge_with_strap.stl" data-file="https://raw.githubusercontent.com/EmilyBennett/emilybennett.github.io/master/nose_bridge.stl"></div>
